import React from 'react';
import logo from './logo.svg';
import Profile from "./components/profile/profile";
import "./app.scss";
import { Helmet } from 'react-helmet'
function App() {
  return (
    <div className="App">
        <Helmet>
          <title>{"Kate Klem"}</title>
            <Profile/>
        </Helmet>

    </div>
  );
}

export default App;
